import React from "react";
import Aux from "./Auxliliary/Auxiliary";


const Card = (props) => {
  return (
    <Aux>
    
      <div className="div1">
      <div>
      <h1>{props.head1}</h1>
      </div>
      <div className = "div2">
      <span>{props.children}</span>
        <p>Hello! The world is beuatiful</p>
        <button>Click me</button>
      </div>
        
      </div>

    </Aux>
  );
};

export default Card;
